import React from 'react'
import Header from './Header'

const Main = () => {
  return (
    <div>
    <Header />
    <br /><br />
  <div style={{ textAlign: 'center', color: 'darkblue', fontStyle: 'bold'}}><h1>DBSI Addressbook</h1>
  <br /><br /><h5>Created by Karl McPhee September 2021</h5>
   </div></div>
  )
}

export default Main
